{'es-ES': 'A continuación, vamos a detallar todo lo que se adquiere comprando esta finca de alrededor de 85.000 m2, que cuenta con 1580 olivos con riego por goteo y a unas distancias de 7x7. La plantación, en general, es joven ya que los olivos más viejos pueden alcanzar unos 20 años de vida, con esto entendemos que cada año que pase las producciones que dé la finca serán mayores. La producción en un futuro en pleno rendimiento se estima que sea entre 33.000 y 40.000 kg. Los terrenos están situados a la ladera de una elevación de terreno, que evita con sus aires el que los olivos se hielen y el tipo de tierra es caliza, que evita muchas posibles enfermedades y la pérdida de humedad. La finca cuenta con un tractor, una pequeña embotelladora, dos depósitos de 2.500 litros cada uno para almacenar el aceite y un depósito de achique con bomba. También se cuenta con dos pozos de agua para uso de la propiedad y el riego por goteo, vallado de la finca principal, registro sanitario, marca propia (glen óleum real), página web con tienda online por explotar donde se pueden incorporar más productos, la dirección web es www.almanzarasananton.es.

La casa que tiene la propiedad es de reciente construcción (2018) y si el nuevo propietario necesitase ampliar la vivienda o almacén no tendría ningún problema dadas las dimensiones de la finca. Además, también cuenta con pista de tenis o frontón, aparcamiento y una pequeña arboleda de grandes pinos. En general, una gran finca con muchas posibilidades de crecimiento, que produce un aceite de calidad extrema y que siempre tendrá su mercado para los mejores paladares.
Esta propiedad se encuentra en un enclave espectacular, con unas vistas increíbles y donde el entorno desprende una sensación de relajación muy placentera. Almansa se encuentra a tan solo 98 km (50 minutos) del aeropuerto del Altet (Alicante) y a 120 km (una hora) del aeropuerto de Manises. Almansa cuenta con parada de autobuses y tren, hospital, restaurantes excelentes, colegios privados y públicos, supermercados, centros deportivos, clubs de tenis, piscina cubierta, comercios de todos los sectores. Es una ciudad que posee absolutamente todos los servicios. Esta propiedad se encuentra a unos cinco minutos en coche de la población y demás servicios.'}

