{'es-ES': 'Bonita vivienda situada en Alborea, típico pueblo de la Manchuela cercano al río Cabriel uno de los ríos más cristalinos de Europa. A sólo 2 Km se encuentra el paraje La Cañada, un lugar reservado para disfrutar del aire libre y la naturaleza. Muy cercano a Alcalá del Júcar, uno de los pueblos más pintorescos de España, por la particularidad de sus casas excavadas en la montaña y sus famosas cuevas. Alborea está cerca de otros muchos lugares de interés como Jorquera, la población con más relevancia histórica de la región o Cenizate, una bonita zona rodeada de pinos y vegetación, con diversos senderos para pasear.

Es una luminosa casa rústica con historia y grandes posibilidades de rehabilitación para segunda vivienda o casa rural. Cuenta con una amplia parte totalmente reformada con sala de estar, porche, cocina, baño, tres habitaciones, planta superior diáfana con terraza y un patio interior. 

Contigua al patio se conserva la vivienda original del siglo XIX, una auténtica construcción de calidad tipo cueva, en perfecto estado y totalmente acondicionada para vivir. Esta parte antigua dispone de salón con chimenea, alhacena, dos dormitorios y cámara superior donde se almacenaba antiguamente la cosecha y el trigo'}

